import React, { useState } from 'react'
import { Button, Modal } from 'antd'
import { QrcodeOutlined } from '@ant-design/icons';
import QRCode from "react-qr-code";

export default function CodeGenerate() {
    const [isModalOpen, setIsModalOpen] = useState(false);

    const url = 'https://sistema.recreamed.com/register'

    const showModal = () => {
        setIsModalOpen(true);
    };
    const handleOk = () => {
        setIsModalOpen(false);
    };
    const handleCancel = () => {
        setIsModalOpen(false);
    };
    return <div>
        <Button className='btnIconCentered' style={{ height: 30, marginLeft: 6 }} onClick={showModal} size='small' icon={<QrcodeOutlined />} shape='round' type="primary" ghost >Registrar con QR</Button>

        <Modal title="Registro por QR" open={isModalOpen} onOk={handleOk} onCancel={handleCancel}>
            <p>Comparta el siguiente enlace para registrar un nuevo paciente</p>
            <QRCode value={url} />
        </Modal>
    </div>

}
